import React, {Component} from 'react';
import './Sidebar.css';
import {Link} from "react-router-dom";
import {connect} from 'react-redux';

const SidebarComponent = (props) => {
        return (
            <div className={'menu'}>
                <div><Link to='/'>Профиль</Link></div>
                <div><Link to={`/dialogs`}>Сообщения</Link></div>
                <div><Link to='/news'>Новости</Link></div>
                <div><Link to='/music'>Музыка</Link></div>
                <div><Link to='/setting'>Настройки</Link></div>
            </div>
        );
}

const mapStateToProps = (state) => {
    return {
        currentCorresspondentId: state.dialogData.currentCorresspondentId
    }
};

const ConnectedSidebarComponent = connect(mapStateToProps)(SidebarComponent);

export default ConnectedSidebarComponent;
